-- ----------------------------
-- Table structure for wemall_vip_card
-- ----------------------------
DROP TABLE IF EXISTS `wemall_vip_card`;
CREATE TABLE `wemall_vip_card` (
  `id` int(6) NOT NULL COMMENT '会员卡id',
  `name` varchar(50) NOT NULL COMMENT '会员卡名称',
  `photo` varchar(200) NOT NULL COMMENT '图片',
  `type` tinyint(1) NOT NULL COMMENT '类别（1--银卡；2--金卡；3--白金）',
  `sort` int(6) NOT NULL COMMENT '排序',
  `discount` varchar(10) DEFAULT NULL COMMENT '享受折扣',
  `freight_free` tinyint(1) NOT NULL COMMENT '是否免邮',
  `usage_known` varchar(255) NOT NULL COMMENT '使用须知',
  `obtain_setting` varchar(255) NOT NULL COMMENT '领取设置',
  `seller_tip` varchar(255) NOT NULL COMMENT '商家提醒',
  `order_num` int(11) NOT NULL COMMENT '交易笔数',
  `consume_num` int(11) NOT NULL COMMENT '消费金额',
  `score_num` int(11) NOT NULL COMMENT '累计积分',
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员卡表';

