DROP TABLE IF EXISTS `wx_accesslog`;
CREATE TABLE `wx_accesslog` (
  `logid` int(10) NOT NULL AUTO_INCREMENT COMMENT '日志ID',
  `accessdate` datetime NOT NULL COMMENT '访问日期',
  `fromusername` varchar(40) DEFAULT NULL COMMENT '发送者',
  `tousername` varchar(40) DEFAULT NULL COMMENT '接收者',
  `msgtype` varchar(10) DEFAULT NULL COMMENT '消息类别',
  `event` varchar(30) DEFAULT NULL COMMENT '事件类别',
  `eventkey` varchar(100) DEFAULT NULL COMMENT '时间key',
  `responseflag` int(10) DEFAULT NULL COMMENT '是否回复',
  `responsedate` datetime DEFAULT NULL COMMENT '回复时间',
  `spenttime` int(10) DEFAULT NULL COMMENT '花费时间',
  `params` varchar(800) DEFAULT NULL COMMENT '消息字符串',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`logid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信服务号日志表，微信和后台程序交互所有的日志';

