-- ----------------------------
-- Table structure for wx_serviceaccount
-- ----------------------------
DROP TABLE IF EXISTS `wx_serviceaccount`;
CREATE TABLE `wx_serviceaccount` (
  `sa_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `serviceid` varchar(50) NOT NULL COMMENT '服务号ID',
  `serviceno` varchar(50) NOT NULL COMMENT '服务号NO',
  `sa_name` varchar(50) DEFAULT NULL COMMENT '服务号名称',
  `service_url` varchar(255) DEFAULT NULL COMMENT '服务号URL',
  `token` varchar(30) DEFAULT NULL COMMENT 'token',
  `appid` varchar(30) DEFAULT NULL COMMENT 'appID',
  `appsecret` varchar(50) DEFAULT NULL COMMENT 'app秘钥',
  `paysignkey` varchar(50) DEFAULT NULL COMMENT '支付签名key',
  `partnerid` varchar(50) DEFAULT NULL,
  `partnerkey` varchar(50) DEFAULT NULL,
  `notify_url` varchar(255) DEFAULT NULL COMMENT '回调url',
  `redirect_uri` varchar(255) DEFAULT NULL,
  `authstatus` char(1) NOT NULL COMMENT '认证状态',
  `accounttype` char(1) NOT NULL COMMENT '服务号类型',
  `companyid` bigint(10) DEFAULT NULL COMMENT '公司ID',
  `sl_appcode` varchar(20) DEFAULT NULL COMMENT 'app识别码',
  `status` char(1) NOT NULL COMMENT '状态',
  `description` varchar(200) DEFAULT NULL COMMENT '描述',
  `access_token` varchar(200) DEFAULT NULL COMMENT 'tonken',
  `access_token_expiry` int(10) DEFAULT NULL COMMENT 'token过期时间',
  `serviceperson` varchar(200) DEFAULT NULL COMMENT '服务人员',
  `templateid` int(11) DEFAULT NULL COMMENT '回复模板ID',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`sa_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='微信服务号表，存放服务号相关信息';

