-- ----------------------------
-- Table structure for wx_subscriber
-- ----------------------------
DROP TABLE IF EXISTS `wx_subscriber`;
CREATE TABLE `wx_subscriber` (
  `subscriberid` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '绑定着ID',
  `isserviceperson` char(1) DEFAULT NULL COMMENT '是否服务人员',
  `serviceid` varchar(30) NOT NULL COMMENT '服务号ID',
  `openid` varchar(50) NOT NULL COMMENT 'openID',
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `sex` char(1) DEFAULT NULL COMMENT '性别',
  `country` varchar(50) DEFAULT NULL COMMENT '国籍',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '区县',
  `language` varchar(20) DEFAULT NULL COMMENT '语言',
  `headimgurl` varchar(150) DEFAULT NULL COMMENT '头像url',
  `subscribe` char(1) NOT NULL COMMENT '是否预约',
  `subscribe_time` datetime DEFAULT NULL COMMENT '预约时间',
  `unsubscribe_time` datetime DEFAULT NULL COMMENT '取消预约时间',
  `wx_userid` varchar(64) DEFAULT NULL COMMENT '微信用户ID',
  `sl_userid` varchar(64) DEFAULT NULL COMMENT '用户ID',
  `status` char(1) NOT NULL COMMENT '状态',
  `description` varchar(200) DEFAULT NULL COMMENT '描述',
  `sa_id` int(10) DEFAULT NULL,
  `sellercode` varchar(10) DEFAULT NULL COMMENT '销售者编码',
  `loginname` varchar(50) DEFAULT NULL COMMENT '登陆名',
  `Mobile` varchar(30) DEFAULT NULL COMMENT '手机号',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`subscriberid`),
  KEY `FK_Reference_25` (`sa_id`),
  CONSTRAINT `FK_Reference_25` FOREIGN KEY (`sa_id`) REFERENCES `wx_serviceaccount` (`sa_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信关注表，用户关注微信服务号后写入';

