  `country` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '国家',
  `province` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '省市',
  `city` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '县',
  `language` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '语言',
  `sl_userid` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户ID',
  `status` char(1) CHARACTER SET utf8 NOT NULL COMMENT '状态',
